import { Route } from "react-router-dom";

export default function ProtectionRoute({ component: Component, ...rest }) {
  return (
    <Route
      {...rest}
      render={props => {
        if (condition) {
          return <Component {...props} />;
        } else {
        }
      }}
    />
  );
}
